import React from "react";
import "./Header.css";
import PersonIcon from "@material-ui/icons/Person";
import IconButton from "@material-ui/core/IconButton";

function Header() {
  return (
    <div className="header">
      <IconButton>
        <PersonIcon fontSize="large" className="header_icon" />
      </IconButton>
      <img
        className="header_logo"
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.globaldatinginsights.com%2Fnews%2Ftinder-updates-design-of-flame-logo%2F&psig=AOvVaw0KGT-gtKHSUuzidkCmA4WH&ust=1622877856613000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCIDS_6S5_fACFQAAAAAdAAAAABAD"
        alt=""
      />
    </div>
  );
}

export default Header;
